import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { useState } from 'react';
import { HouseDoorFill } from 'react-bootstrap-icons';

const arrData=[
  {
      "id": 15,
      "title": "HTML CSS Pro",
      "slug": "htmlcss",
      "href": "https://fullstack.edu.vn",
      "description": "Từ cơ bản tới chuyên sâu, thực hành 8 dự án, hàng trăm bài tập, trang hỏi đáp riêng, cấp chứng chỉ sau khóa học và mua một lần học mãi mãi.",
      "image_url": "https://files.fullstack.edu.vn/f8-prod/courses/15/62f13d2424a47.png",
      "icon_url": "https://files.fullstack.edu.vn/f8-prod/courses/15/62385d6c63dfa.png",
      "video_url": "",
      "landing_page_url": "/landing/htmlcss",
      "is_pre_order": false,
      "is_published": true
  },
  {
      "id": 27,
      "title": "Ngôn ngữ tiền xử lý Sass",
      "slug": "sass",
      "href": "https://fullstack.edu.vn",
      "description": "Đây là một khóa học nhỏ được tách ra từ 2 chương học trong khóa HTML CSS Pro. Kiến thức về Sass trong khóa này bạn có thể áp dụng ngay vào các dự án của bạn.",
      "image_url": "https://files.fullstack.edu.vn/f8-prod/courses/27/64e184ee5d7a2.png",
      "icon_url": "https://files.fullstack.edu.vn/f8-prod/courses/27/64e0daf212fad.png",
      "video_url": "https://videos.fullstack.edu.vn/f8-prod/courses/27/oeT5zTmdk8KlHwU2meMJpnR7uihkX6OvYxnkjiB9.mp4",
      "landing_page_url": "/landing/sass",
      "is_pre_order": false,
      "is_published": true
  },
  {
      "id": 19,
      "title": "JavaScript Pro",
      "slug": "javascript",
      "href": "https://fullstack.edu.vn",
      "description": "Khóa học JavaScript Pro",
      "image_url": "https://files.fullstack.edu.vn/f8-prod/courses/19/62f13cb607b4b.png",
      "icon_url": "https://files.fullstack.edu.vn/f8-prod/courses/19/62f13cb685c81.png",
      "video_url": "",
      "landing_page_url": "/landing/javascript",
      "is_pre_order": false,
      "is_published": false
  },
  {
      "id": 20,
      "title": "NextJS Pro",
      "slug": "reactjs-pro",
      "href": "https://fullstack.edu.vn",
      "description": "Khóa học NextJS Pro",
      "image_url": "https://files.fullstack.edu.vn/f8-prod/courses/20/648020fc16597.png",
      "icon_url": "https://files.fullstack.edu.vn/f8-prod/courses/20/648020fcc8000.png",
      "video_url": "",
      "landing_page_url": "/landing/reactjs-pro",
      "is_pre_order": false,
      "is_published": false
  }
];
function ButtonProps({Component, ...buttonProps}){
  if(typeof Component !== 'undefined'){
  buttonProps.className = 'btn btn-outline-info m-2';
      return(
          <Component {...buttonProps}>
              {buttonProps.title}
          </Component>
      )
  }
}
function InputProps({Label,...InputProps}){
  if(typeof Label !== 'undefined'){
      return(
          <div>
              <label className="m-2">{Label}</label>
              <input {...InputProps}>
              </input>
          </div>
      )
  }
}
function List({data, children}){
  return (
      <ul>
          {data.map((...props)=>children(...props))}
      </ul>
  )
}
const cars=['xe điện đụng', 'BMW', 'HONDA'];
const gifts=['BMW','WAVE','HONDA'];
const cour=[
  {id:1,name:'BMW'},
  {id:2,name:'WAVE'},
  {id:3,name:'HONDA'}
];
function TextHtml({item, onClick}){
  const data1=['chiến','huy','thủy'];
  const [gift, setGifts] = useState();
  const randomGift = () => {
    const index = Math.floor(Math.random() * gifts.length);
    setGifts(gifts[index]);
  }

  if(typeof item !== 'undefined'){
      return(
          <div className="post-item">
              <img src={item.image_url} alt={item.title} />
              <h1 onClick={() => onClick(item)}>
                  {item.title}
              </h1>
              <p>{item.description}</p>
              <ButtonProps Component="a" title={<HouseDoorFill className='fs-4'/>} target="_blank" href="/"/>
              <ButtonProps Component="button" title="click me alert" onClick={()=>alert("xin chào")} />
              <InputProps Label="Fullname" type="text" className="form-control m-2" placeholder="Enter name..."/>
              <List data={cars}>{(item, index)=><li key={index}>{item}</li>}</List>
              <HouseDoorFill className='m-2 fs-4' style={{color:'red'}}/>
              <CallBack data={data1}>
                {(item)=><li>{item}</li>}
              </CallBack>
              <h1 className='m-2'>{ gift || 'chưa có thưởng' }</h1>
              <button className='m-2' onClick={randomGift}>Get Gift</button>
              <div>{cour.map(item => {<input key={item.id} type='radio'>{item.name}</input>})}
              </div>
          </div>
      )
  }
}
function CallBack({data,children}){
  return (
    <ul>{data.map((...props)=>children(...props))}</ul>
  )
}

function App() {

  const handleClick = (item) => {
      alert(item.title);
  }

  return(
      <div className="post-list">{
        arrData.map((item) => (
        <TextHtml key={item.id} item={item} onClick={handleClick} />
        ))
    }
      </div>
  )
};

export default App;
